  /* Red gradients for blood */
  background: linear-gradient(red 50%, transparent 60%), radial-gradient(#d40000 50%, transparent 70%), radial-gradient(red 30%, transparent 40%), radial-gradient(#d40000 10%, transparent 20%), radial-gradient(red 10%, transparent 15%);
