// LOCATION

*{ box-sizing: border-box; }


.buttons{
    margin-top: 100px;
    .button{
        border: none;
        display: inline-block;
        padding: 8px 16px;
        vertical-align: middle;
        overflow: hidden;
        text-decoration: none;
        color: inherit;
        background-color: inherit;
        text-align: center;
        cursor: pointer;
        margin-bottom: 30px;
        border: none;
        outline: none;
        margin-right: 5px;
    }
}


.button--green{
    color: #fff!important;
    background-color: #4CAF50!important;
}

.button--red{
    color: #fff!important;
    background-color: $redColor!important;
}

.button[disabled=true]{
  border: 1px solid #999999!important;
  background-color: #cccccc!important;
  color: #666666!important;
}

.button--default{
    color: #000!important;
    background-color: #f1f1f1!important;
}

@media screen and (min-width: 820px) and (max-width: 992px){
    .locations{
        &_details{
           width: 33%;
           padding: 10px;
        }
    }
}

@media screen and (min-width: 992px){
    .locations{
        &_details{
           padding: 10px;
        }
    }
}

// AUTOCOMPLETE
.autocomplete {
    position: relative;
    width: 100%;
    text-align: center;
    display: flex;
    justify-content: center;

  input {
    border: 1px solid transparent;
    background-color: #f1f1f1;
    padding: 10px;
    font-size: 16px;
  }

  input[type=text] {
    background-color: #f1f1f1;
    width: 100%;
  }

  input[type=submit] {
    background-color: $redColor;
    color: #fff;
    cursor: pointer;
  }

  .autocomplete-items {
    position: absolute;
    border: 1px solid #d4d4d4;
    border-bottom: none;
    border-top: none;
    z-index: 99;
    /*position the autocomplete items to be the same width as the container:*/
    top: 100%;
    left: 0;
    right: 0;
  }

  .autocomplete-items div {
    padding: 10px;
    cursor: pointer;
    background-color: #fff; 
    border-bottom: 1px solid #d4d4d4; 
  }

  /*when hovering an item:*/
  .autocomplete-items div:hover {
    background-color: #e9e9e9; 
  }

  /*when navigating through the items using the arrow keys:*/
  .autocomplete-active {
    background-color: DodgerBlue !important; 
    color: #ffffff; 
  }

}

// Ribbons
.ribbon {
$default-right: 10px;
$default-top: -2px;
$default-color: #2ca7d8;
$default-width: 40px;
$default-height: 45px;

position: absolute;
right: var(--right, $default-right);
top: var(--top, $default-top);

filter: drop-shadow(2px 3px 2px rgba(black, 0.5));

> .content {
    color: white;
    font-size: 1.25rem;
    text-align: center;
    font-weight: 400;
    background: var(--color, $default-color) linear-gradient(45deg, rgba(black, 0) 0%, rgba(white, 0.25) 100%);
    padding: 8px 2px 4px;


    clip-path: polygon(0 0, 100% 0, 100% 100%, 50% 100%, 0 100%);

    width: var(--width, $default-width);
    min-height: var(--height, $default-height);

    transition: clip-path 1s, padding 1s, background 1s;
}

&.slant-up > .content {
    clip-path: polygon(0 0, 100% 0, 100% calc(100% - 12px), 50% calc(100% - 6px), 0 100%);
}

&.slant-down > .content {
    clip-path: polygon(0 0, 100% 0, 100% 100%, 50% calc(100% - 6px), 0 calc(100% - 12px));
}

&.down > .content {
    clip-path: polygon(0 0, 100% 0, 100% calc(100% - 8px), 50% 100%, 0 calc(100% - 8px));
}

&.up > .content {
    clip-path: polygon(0 0, 100% 0, 100% 100%, 50% calc(100% - 8px), 0 100%);
}

&.check > .content {
    clip-path: polygon(0 0, 100% 0, 100% calc(100% - 20px), 40% 100%, 0 calc(100% - 12px));
}
}

